import React from 'react';
import logo from './logo.svg';
import './App.css';
import Dashboard from './components/Dasboard';
import Device from './components/device';

function App() {
  return (
    <div className="App">
      <Dashboard/>
      <div className="container"> 
      <div className="row">
        <div className ="col-md-3">
          <Device />
      </div>
      </div></div>
    </div>
  );
}

export default App;
